// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

interface ISyndicateClosedEndFundStoreGettersV0 {
    function isManager(address manager) external returns (bool);

    function managerCurrent(address syndicateAddress)
        external
        returns (address);

    function managerPending(address syndicateAddress)
        external
        returns (address);

    function managerFeeAddress(address syndicateAddress)
        external
        returns (address);

    function managerManagementFeeBasisPoints(address syndicateAddress)
        external
        returns (uint256);

    function managerDistributionShareBasisPoints(address syndicateAddress)
        external
        returns (uint256);

    function syndicateDistributionShareBasisPoints(address syndicateAddress)
        external
        returns (uint256);

    function numMembersMax(address syndicateAddress) external returns (uint256);

    function numMembersCurrent(address syndicateAddress)
        external
        returns (uint256);

    function depositERC20Address(address syndicateAddress)
        external
        returns (address);

    function depositMemberMin(address syndicateAddress)
        external
        returns (uint256);

    function depositMemberMax(address syndicateAddress)
        external
        returns (uint256);

    function depositTotalMax(address syndicateAddress)
        external
        returns (uint256);

    function depositTotal(address syndicateAddress) external returns (uint256);

    function depositMember(address syndicateAddress, address memberAddress)
        external
        returns (uint256);

    function distributionERC20Addresses(
        address syndicateAddress,
        address distributionERC20Address
    ) external returns (bool);

    function distributionTotal(
        address syndicateAddress,
        address distributionERC20Address
    ) external returns (uint256);

    function distributionClaimedTotal(
        address syndicateAddress,
        address distributionERC20Address
    ) external returns (uint256);

    function distributionClaimedMember(
        address syndicateAddress,
        address distributionERC20Address,
        address memberAddress
    ) external returns (uint256);

    function dateCreated(address syndicateAddress) external returns (uint256);

    function dateClose(address syndicateAddress) external returns (uint256);

    function open(address syndicateAddress) external returns (bool);

    function distributing(address syndicateAddress) external returns (bool);

    function modifiable(address syndicateAddress) external returns (bool);

    function allowlistEnabled(address syndicateAddress) external returns (bool);

    function allowlist(address syndicateAddress, address memberAddress)
        external
        returns (bool);

    function transferable(address syndicateAddress) external returns (bool);

    function metadata(address syndicateAddress, string calldata key)
        external
        returns (string memory);

    function notCloseable(address syndicateAddress) external returns (bool);
}
